function xor(txt, pass) {

  var ord = []
  var buf = ""

  for (z = 1; z <= 255; z++) {
    ord[String.fromCharCode(z)] = z
  }

  for (j = z = 0; z < txt.length; z++) {
    buf += String.fromCharCode(ord[txt.substr(z, 1)] ^ ord[pass.substr(j, 1)])
    j = (j < pass.length) ? j + 1 : 0
  }

  return buf

}
